INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 0, "2030/12/17 14:59:59", 102601, 24001, 1, 0.0, 1, "あたしだって\nやるときはやるよ！", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 1, "2030/12/17 14:59:59", 102601, 24002, 1, 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 2, "2030/12/17 14:59:59", 102601, 24003, 1, 0.0, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 3, "2030/12/17 14:59:59", 102601, 24004, 2, 0.0, 2, "やったね！\nこれでようやく\nサボれるよ…", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 4, "2030/12/17 14:59:59", 102601, 24005, 1, 0.0, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 5, "2030/12/17 14:59:59", 102601, 24006, 2, 0.0, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 6, "2030/12/17 14:59:59", 102601, 24007, 2, 0.0, 2, "あたしも意外と\nやるもんでしょ？", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 7, "2030/12/17 14:59:59", 102601, 24008, 4, 0.0, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 8, "2030/12/17 14:59:59", 102601, 24009, 4, 0.0, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 9, "2030/12/17 14:59:59", 102601, 24010, 4, 0.0, 4, "まじめに\nやったんだけどな…\n悔しいな～", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 10, "2030/12/17 14:59:59", 102601, 24011, 4, 0.0, 4, "やられた…\nねずみって意外と\nてごわいね", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0.0, "リン", 11, "2030/12/17 14:59:59", 102601, 24012, 4, 0.0, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 24, 0.0, "2020/04/30 12:00:00", 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (1.81, "リン", 12, "2030/12/17 14:59:59", 102601, 24013, 1, 0.0, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 24, 0.0, "2020/04/30 12:00:00", 10040);
